description.text:
The AlwaysON is conveniently optimized to fit as one build in the New Makerbot Replicator. Combine the print files and your DualStrusion Replicator can print your AlwaysON in one session. You pick the color and material for the AlwaysON and use PVA for the support material. The AlwaysON uses 2.6 cubic inches of material while the support is a respectable 41.7 cubic inches of PVA.
Once the printing is complete, dock your iPhone and attach the 2 retina mirrors (960x640 pixels) to complete your HUD.
Slip your AlwaysON into your ear and &quot;keep an eye on it&quot;
